matrix = []
largestX, largestY = 0.0, 0.0
smallestX, smallestY = 500.0, 500.0

for name in imageNames:
  image = name.split(',')
  x = image[0]
  y = image[1].split('.')[0] + "." + image[1].split('.')[1]
  
  x, y = float(x), float(y)
  
  if x < 0 or y < 0:
    break;
  
  matrix.append([x, y])
  
  if x > largestX:
    largestX = x
  if y > largestY:
    largestY = y
  
  if x < smallestX:
    smallestX = x
  if y < smallestY:
    smallestY = y
    

